      'data_float' => '0',
      'data_int' => '1045487555',
      'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>eZ Publish comes with a multitude of features out of the box, ensuring that you can quickly put your content online.</paragraph></section>',
      'data_type_string' => 'ezxmltext',
      'id' => '589',
