    525 => array (
      'attribute_original_id' => '0',
      'contentclassattribute_id' => '186',
      'contentobject_id' => '118',
      'data_float' => '0',
      'data_int' => '1045487555',
      'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/"><section><paragraph>To provide you with full control over your website, eZ Publish has many features that make it easy to manage both content and users.</paragraph></section></section>',
      'data_type_string' => 'ezxmltext',
      'id' => '637',
      'language_code' => 'eng-US',
      'language_id' => '2',
      'sort_key_int' => '0',
