    ),
    589 => array (
      'attribute_original_id' => '0',
      'contentclassattribute_id' => '186',
      'contentobject_id' => '130',
      'data_float' => '0',
      'data_int' => '1045487555',
      'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>This tutorial gives developers the power to extend the features and flexibility of eZ Publish beyond a single website, to having an unlimited number in one installation. At the end of this tutorial you will have learned how to best leverage eZ Publish\'s siteaccess concept to create multiple websites. It will let you apply this concept through the concrete case of building two different, multilingual websites on one single eZ Publish instance.</paragraph></section>',
      'data_type_string' => 'ezxmltext',
      'id' => '701',
      'language_code' => 'eng-US',
      'language_id' => '2',
      'sort_key_int' => '0',
      'sort_key_string' => '',
      'version' => '1',
    ),
    590 => array (
      'attribute_original_id' => '0',
      'contentclassattribute_id' => '187',
      'contentobject_id' => '130',
      'data_float' => '0',
      'data_int' => '1045487555',
      'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><section><header>Introduction</header><paragraph>Users of eZ Publish sometimes wonder if it is possible to make use of a single installation of eZ Publish for multiple websites. The answer is yes - through the power of the siteaccess. In fact, an understanding of siteaccesses gives one the ability to do much more than just host multiple sites in one installation. With this technique you can:</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">make it easier to share content between databases</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">copy and add locations to objects</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">use a single Premium agreement and one eZ Network extension for multiple sites with the same or different content</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">simplify eZ Publish upgrades by consolidating several sites on one installation</paragraph></li></ul></paragraph><paragraph>This is demo content, to continue real reading, please visit&amp;nbsp;<link target="_blank" url_id="93">share.ez.no</link></paragraph></section><section><header>About the author : Greg McAvoy-Jensen</header><paragraph>Greg is the executive director of&amp;nbsp;<link target="_blank" xhtml:title="Granite Horizon" url_id="94">Granite Horizon</link>, one of the largest eZ Publish development firms in the United States of America. A certified eZ Publish developer, he has served clients and trained developers on four continents since he started working with eZ Publish in 2003. His wife Heather and he are proud parents of three wonderful children.</paragraph></section></section>',
