      'data_int' => '1045487555',
      'data_text' => '<?xml version="1.0"?>
<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><section><section><header>What is content and design?</header><paragraph>Content is information that is organized and stored in a structured manner by <link url_id="97">eZ Publish</link>. For example, content may be the components of a news article (such as the title, introduction, body, and images) or the properties of a car (such as the model, year, and color). </paragraph><paragraph>All information that is stored for the purpose of later retrieval is referred to as content. The presentation of content is determined by the design of a site. </paragraph><paragraph>While content refers to structured data, design refers to the way the data is visually presented. Design includes the things that make up a web interface: HTML, stylesheets (CSS), images that are not part of the content, typography, fonts, and so on. </paragraph><paragraph>So, while content deals with storing and structuring data, design dictates how the content should be presented. </paragraph><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="192"/></paragraph></section></section><section><section><header>Benefits of a Content Management System</header><paragraph>The ability to handle the distinction between structuring and displaying content is one of the <link url_id="98">key features of eZ Publish</link>. The separation of content and design provides the following benefits: </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Content editors and designers can work separately without conflicts</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Content can be published easily in multiple formats</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Content can easily be transferred and re-purposed</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Global redesigns and changes can be applied with simple modifications</paragraph></li></ul></paragraph></section></section><section><section><header>Presenting the content: templates</header><paragraph>Templates represent the fundamental unit of site design in eZ Publish. For example, a template might dictate that a page should appear with the site\'s title at the top and with the main content in the middle. When the page is accessed, the Content Management System places the content (the actual title and body text) into the appropriate locations in the template. </paragraph><paragraph>An eZ Publish template is a custom, extended HTML file that describes how particular types of content should be presented. For example, there is a template for viewing a folder and its contents, a news article, the contents of a <link anchor_name="picturegallery" url_id="99">gallery</link> as thumbnails, <link anchor_name="videoplayer" url_id="100">media files</link> as list items, <link anchor_name="visitorinteraction" url_id="101">forum posts</link> and so on. </paragraph><paragraph>In some cases, you can even have different article templates based on different kinds of articles or where they are located in the content hierarchy. In short, templates are the transforming unit that produces the site layout, either for an entire webpage or some part of that page. The following screenshots illustrate how different templates work together to produce a page. </paragraph><paragraph> Learn more in <link url_id="102">Developers section</link>. </paragraph></section></section></section>
