<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="eztoolbar" url_id="98">Publish content from your web browser</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="openofficeimport" url_id="98">Publish content from word processors</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="contenttranslation" url_id="98">Translate your content</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="multiupload" url_id="98">Upload multiple files at once</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="picturegalleries" url_id="98">Picture galleries</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="videopublishing" url_id="98">Video publishing</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="web2.0" url_id="98">Web 2.0 features</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="defaultsearch" url_id="98">Search</link></paragraph></li></ul></paragraph><section><section><header>Publish content from your web browser</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="199"/></paragraph><paragraph>With eZ Publish, you can publish content like articles, pictures and files directly from your web browser, using the Website Toolbar. </paragraph><paragraph>This toolbar appears when you log in and enables you to publish, move, replace or translate any kind of content. </paragraph><paragraph>The Online Editor is a WYSIWYG editor integrated into the website (no HTML coding required), providing formatting functions similar to word processing applications. </paragraph></section></section><section><section><header>Publish content from your favourite word processor</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="194"/></paragraph><paragraph>Many content managers prefer working directly in Microsoft Word or Open Office. The import / export feature enables you to create or edit site content in your favorite word processor, even when you might not have Internet access. </paragraph><paragraph>Afterwards, you can upload the document through either a WebDAV client or the front-end of your site to generate or update articles, documentation pages and so on. </paragraph></section></section><section><section><header>Translate your content</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="195"/></paragraph><paragraph>All content in eZ Publish can be translated to multiple languages. Having only one website to administer is efficient and makes it easier to maintain a consistent brand across languages and countries. </paragraph><paragraph>An international corporation or organization can have one website with content in several languages. When a visitor selects a language, the menus and content are displayed accordingly. If you have not yet translated specific content, it will be shown in the source language or not at all (depending on your configuration). </paragraph><paragraph>When you are editing content, you can choose to switch the language you are currently editing or to translate from one language to another. Content in the source language is shown when you are translating, to aid in the process. When creating or updating content translations, you can also use the built-in content &#x201C;diff&#x201D; functionality to see the added or removed text in the source language. </paragraph><paragraph>Multiple, multilingual URLs can be created for each page. By default, you can have an object called "Easy" with a URL "/easy" but also create a French translation with a URL "/facile". </paragraph></section></section><section><section><header> Upload multiple files at once</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="196"/></paragraph><paragraph>If you want to upload more than one document, picture or video at a time, eZ Publish has multi-upload functionality. </paragraph><paragraph>You simply select the content you want from your computer or from the server where your content is stored. eZ Publish can detect the type of content uploaded and creates the appropriate web pages. </paragraph></section></section><section><section><header>Picture galleries</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="197"/></paragraph><paragraph>eZ Publish makes it easy to create picture galleries. With the multi-upload functionality, you can add many pictures at once, then eZ Publish will scale, format and resize the pictures automatically. </paragraph><paragraph>You can then browse through the galleries and re-use images elsewhere in your website. </paragraph></section></section><section><section><header>Video publishing</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="200"/></paragraph><paragraph>Basically, a video is another type of content you or users of your website can publish. You can use eZ Publish to store and display any video format for web TV functionality or video publishing similar to Youtube. </paragraph></section></section><section><section><header>Web 2.0 features</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="201"/></paragraph><paragraph>Tag clouds, blogs, forums and polls are all built-in eZ Publish features. Make your users contribute and build communities. </paragraph></section></section><section><section><header>Search</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="198"/></paragraph><paragraph>To find any content on your eZ Publish site, you can use the integrated search engine in eZ Publish. To add more functionality and scale high-loaded websites, <link url_id="84">eZ Find</link> is an enterprise search extension for eZ Publish. </paragraph></section></section></section>
